import React,{ useState } from 'react';


function SignupScreen(){

	const [username, setUsername]     = useState('');
	const [firstname, setFirstname]   = useState('');
	const [lastname, setLastname]     = useState('');
	const [email, setEmail]           = useState('');
	const [password1, setPassword1]   = useState('');
	const [password2, setPassword2]   = useState('');

	const [isPassword1TypePass, setPassword1TypePass]   = useState(true);
	const [isPassword2TypePass, setPassword2TypePass]   = useState(true);

	return(
		<div className='SignupScreen'>
			<input type='text' value={username} onChange={e=>{setUsername(e.target.value)}}/>
			<input type='text' value={firstname} onChange={e=>{setFirstname(e.target.value)}}/>
			<input type='text' value={lastname} onChange={e=>{setLastname(e.target.value)}}/>
			<input type='text' value={email} onChange={e=>{setEmail(e.target.value)}}/>
			<input type={isPassword1TypePass?'password':'text'} value={password1} onChange={e=>{setPassword1(e.target.value)}}/>
			<button onClick={setPassword1(!isPassword1TypePass)}>{isPassword1TypePass?'show':'hide'}</button>
			<input type={isPassword2TypePass?'password':'text'} value={password2} onChange={e=>{setPassword2(e.target.value)}}/>
			<button onClick={setPassword2(!isPassword2TypePass)}>{isPassword2TypePass?'show':'hide'}</button>
		</div>
	);
}

export default SignupScreen;
